import { Link } from "react-router-dom";

function CreateLobby() {
  const [lobbyName, updateLobbyName] = useState("");

  return (
    <div>
      <form>
        <label>
          Room Name:
          <input
            type="text"
            value={lobbyName}
            onChange={(e) => updateLobbyName(e.target.value)}
